if (!xmlIn.isPropertySupported(XMLInputFactory.IS_SUPPORTING_EXTERNAL_ENTITIES)) {
    _logger.warn("Property '" + XMLInputFactory.IS_SUPPORTING_EXTERNAL_ENTITIES + "' not supported");
} else {
    try {
        xmlIn.setProperty(XMLInputFactory.IS_SUPPORTING_EXTERNAL_ENTITIES, Boolean.FALSE);
    } catch (Exception e) {
        _logger.warn("Error setting property '" + XMLInputFactory.IS_SUPPORTING_EXTERNAL_ENTITIES + "' to 'false': " + e.getMessage());
    }
}

